import React, {Component} from 'react';
import LeftBottomBox from './components/LeftBottomBox/LeftBottomBox.js';
import './App.css';

class App extends Component {

  /*constructor(props){
    super(props);
  }*/

  getNumbers = (array) => {
   let nr = array.map(value => value>4 && value<8);
   console.log(nr);
  }

  task2 = () => {
    var originalArray = [3,5,1,9,2,6,7,4];
    this.getNumbers(originalArray);
  }

  onClickHandler = () => {
    alert("click only on inner div");
  }


  render(){

    this.task2();

    return (
      <div className="outer" onClick={this.onClickHandler}>
        <div className="center"/>
        <LeftBottomBox />
        <div className="row">
            <div className="box float-box"/>
            <div className="box float-box"/>
            <div className="box float-box"/>
        </div>
        <div className="new-row box"/>
        <div className="absolute-center box"/>
      </div>
    );
  }

}

export default App;
